# Find Patterns Forming Clumps in a String
# kmer forming (L,t) - clump in genome

def findclump(genome, kmer, length, times):
    lst = []
    # first sliding
    for i in range(len(genome) - length +1):
        window = genome[i:i+length]

        # second sliding - counting k-mers
        dict = {}
        for j in range(len(window)- kmer +1):
            pattern = window[j:j+kmer]
            if pattern in dict:
                dict[pattern] +=1
            else:
                dict[pattern] = 1
        
        tmp = [key for key, values in dict.items() if values == times]
        for k in tmp:
            if k not in lst:
                lst.append(k)
        
    return lst

genome = ""
k = 11
L = 535
t = 17

result = findclump(genome,k,L,t)
print(" ".join(result))